import React, {Component} from 'react';
import './App.css';
class App extends Component {
  state={
    posts:[]
  }

  componentDidMount() {
    const url = "http://localhost:3001";
    fetch(`${url}/posts`, {
        method: 'GET',
        headers: { 
            Authorization: "garrison", 
        },
    })
    .then(response => response.json())
    .then(posts => this.setState({posts}))
  };

  render() {
    const {posts} = this.state;
    return (
      <div className="App">
        <header className="App-header">
          <p>
            Garrison Readable
          </p>
        </header>
        <ul className="posts">
          {posts.map(post => 
            <li key={post.id}>
              <h3>{post.title}</h3>
              <p>{post.body}</p>
            </li>
          )}
        </ul>
      </div>
    )
  }; 
}

export default App;
